  return (
    <div>
      <div className='signup_container'>
      <form className='signup' onSubmit={submithandler}>
        <div>
        <h1 className='h1logo'>Logo</h1> <br/>
        <p>Create New Account</p>
         <input type='text' name='email' value={Email} placeholder='Mail ID'  onChange={changeHandler}/> <br/>
        <input type='password' name='password' placeholder='Password' value={Password} onChange={changeHandler}/> <br/>
        <input type='password' name='confirmpassword' placeholder='Confirm Password' value={ConfirmPassword} onChange={changeHandler}/>
       
        <button onClick={() => { Navigate("/") }}>Sign Up</button> <br/>
        
        </div>
    
        </form>
        <p className='signinfooter' onClick={submithandler}>Sign in</p>
    </div>
    
    
    </div>
  )
}

export default Signup
